<script setup>
import gsap from "gsap";
const props = defineProps({
  isOutside: {
    type: Boolean,
    required: true,
  },
});

watch(props, () => {
  if (!props.isOutside) {
    gsap.to(".jaime-avatar", {
      scale: 1.1,
      rotate: 5,
      transformOrigin: "50% 50%",
      duration: 0.25,
    });
  } else {
    gsap.to(".jaime-avatar", { scale: 1, rotate: 0, duration: 0.25  });
  }
});
</script>
